import { Field } from 'formik';
import React from 'react';

function CommonField(props) {
    const { handelers } = props
    console.log('props  CommonField:>> ', props);
    return (
        <div>
            <label htmlFor="enName">enName</label>
            <Field id="enName" name="enName" />
            {props.errors.enName ? (<div>{props.errors.enName}</div>) : null}

            <label htmlFor="localName">localName</label>
            <Field id="localName" name="localName" />
            {props.errors.localName ? (<div>{props.errors.localName}</div>) : null}

            <label htmlFor="otherName">otherName</label>
            <Field
                id="otherName"
                name="otherName"
            />
            {props.errors.otherName ? (<div>{props.errors.otherName}</div>) : null}

            <label htmlFor="shortCode">shortCode</label>
            <Field
                id="shortCode"
                name="shortCode"
            />
            {props.errors.shortCode ? (<div>{props.errors.shortCode}</div>) : null}

            <button type="submit">Submit</button>
        </div>
    );
}

export default CommonField;
